Accessibility is the key factor while considering public transport. Some of the measures that can be considered for making a transit system more usable by all are as follows:
1- Providing handrails at frequent intervals along both sides of corridors, and inside each car;
2- Allowing people with disabilities to sit wherever they want, rather than reserving some seats behind the wheelchair area;
3- Making sure that rail platforms end in straightaways, so that it becomes easier for passengers to board and deboard trains using assistive devices such as wheelchairs or electric scooters.;
4- Including features like visual announcements indicating approaching train doors and locations of available power outlets, which can help inform visually impaired individuals about what's going on around them ;
5- Making sure that bathroom facilities are located on the main floor (not requiring use of elevators) and have adequate space and furnishings for persons with disabilities;
6- Offering assistance to customers with reduced mobility boarding/disembarking from trains, especially if the station lacks platform edge bars or other means of guidance;
7- Considering customer comfort when determining the appropriate number of cars per consist, allowing sufficient time between consecutive trains during busy times ;
8- Not having too many sharp turns or circular movements within stations due to the risk of derailing wheels off the track.
9 - Having tactile indicators installed at regular intervals along the edges of platform surface to guide blind passengers where the edge of the platform lies.
10 - Using color contrast between platform edging and background paint on station tiles, signage, etcetera to improve readability for visually impaired pedestrians walking alongside tracks.
